import React, { Component } from "react";

class NavBar extends Component {
  state = {};
  render() {
    return (
      <nav class="navbar fixed-bottom navbar-light bg-light">
        <a class="navbar-brand" href="#">
          Fixed bottom
        </a>
      </nav>
    );
  }
}

export default NavBar;
